import Button from '@mui/material/Button';
import './CartDropDown.scss';
import Slide from '@mui/material/Slide';
import CloseIcon from '@mui/icons-material/Close';

const CartDropDown = () => {
  return (
    <Slide timeout={500} direction="left" in={true} mountOnEnter unmountOnExit>
    <div className='cart-slider'>
      <div className='cart-slider-header'>
        <h1>My Cart</h1>
        <span className="cart-slider-close-icon">
          <CloseIcon />
        </span>
      </div>
      <div className='cart-slider-items'>
      ddddd
      
      </div>
      <Button
            sx={{
              marginTop: '30px',
              borderRadius: '0px',
              backgroundColor: 'rgba(224, 11, 203, 1)',
              '&:hover': {
                backgroundColor: 'black',
              }
            }}
            variant="contained" 
            size="large"
            type='submit'
          >
            Sign In
          </Button>
    </div>
    </Slide>
  ) 
}

export default CartDropDown;
